"var fr = JavaImporter(
  org.forgerock.openam.auth.node.api
);
with (fr) {

  var username = sharedState.get("_id")
  var mfaPrefAttribute = "fr-attr-imulti2"
  var mfaType = "";

  if (sharedState.get("web-authn-challenge") != null) {
    mfaType = "webauthn";
  } else if (sharedState.get("pushRegistrationTimeout") != null) {
   	mfaType = "push"
  }

  idRepository.addAttribute(username, mfaPrefAttribute, [mfaType]);

  outcome = "true"
}"
